import React, { useRef, useEffect } from "react";

// import material-ui components
import { makeStyles } from "@material-ui/core/styles";
import { Box } from "@material-ui/core";

// import react-magicscroll
import { Controller, Scene } from "react-scrollmagic";
import { Tween, Timeline } from 'react-gsap';

// custom css styling
const useStyles = makeStyles({
    panel1: {
        height: "100vh"
    }
});

function Contact() {
  const classes = useStyles();


  return (
    <>
      <Box display="flex" justifyContent="center" id="contact">
        <h1 style={{ fontSize: "50px" }}>Get in Touch</h1>
      </Box>

      <Controller>
      <Scene
        triggerHook="onLeave"
        duration="300%"
        pin
      >
        <Timeline
          wrapper={<div id="pinContainer" />}
        >
          <section className="panel1"><span>Panel</span></section>
          <Tween
            from={{ x: '-100%' }}
            to={{ x: '0%' }}
          >
            <section className="panel turqoise"><span>Panel</span></section>
          </Tween>
          <Tween
            from={{ x: '100%' }}
            to={{ x: '0%' }}
          >
            <section className="panel green"><span>Panel</span></section>
          </Tween>
          <Tween
            from={{ y: '-100%' }}
            to={{ y: '0%' }}
          >
            <section className="panel bordeaux"><span>Panel</span></section>
          </Tween>
        </Timeline>
      </Scene>
    </Controller>
    </>
  );
}

export default Contact;
